import axios from "axios"
export const GET_ALL_CHARACTERS = ""


export const getAllcharacters = () =>{
    return async function(dispatch){
        let info = await axios.get("http://localhost:3001/pokemons")
        return dispatch({
            type:GET_ALL_CHARACTERS,
            payload:info.data
        })
    }
}
